import { PrimaryButton, SidebarContainer, TopCTA, MenuItems, MenuItem } from "./Utility";

function Sidebar() {

    const svgIconStyle = {
        fill : "white",
        background  : "red",
        height : "24px",
        width  : "24px"
    }


    return (
    <div>
    <SidebarContainer>
        <TopCTA>
            <PrimaryButton>New Task</PrimaryButton>
        </TopCTA>
        <MenuItems>
            <MenuItem><svg style={svgIconStyle} xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24"><path d="M9,13H15V19H18V10L12,5.5L6,10V19H9V13M4,21V9L12,3L20,9V21H4Z" /></svg>Home</MenuItem>
            <MenuItem>Household</MenuItem>
            <MenuItem>Academic</MenuItem>
            <MenuItem>Other</MenuItem>
        </MenuItems>
    </SidebarContainer>
    </div>
  );
}

export default Sidebar;
